import React from 'react';
import { Component } from "react";
import { Link } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


import MenuRoutes from "./MenuGlobRoutes"


interface Props {
};

interface State {
}


class MenuGlob extends Component<Props, State> {

    constructor(props: Props) {
        super(props);
    }

    render() {
        return (

            <BrowserRouter>
                <div>

                    <Container fluid>
                        <Row>
                            <Col> <Link to='/'>FirstApp</Link> </Col>
                            <Col> <Link to='/CounterApp'>CounterApp</Link> </Col>
                            <Col> <Link to='/MyComponentLife'>MyComponentLife</Link>   </Col>                            
                        </Row>
                        <Row>                            
                            <Col> <Link to='/NameForm'>NameForm</Link> </Col>                            
                            <Col> <Link to='/DNameForm'>DNameForm</Link> </Col>                            
                            <Col> <Link to='/TextAreaForm'>TextAreaForm</Link> </Col>                                                        
                        </Row>
                        <Row>                            
                            <Col> <Link to='/ListForm'>ListForm</Link> </Col>                            
                            <Col> <Link to='/RadiobuttonForm'>RadiobuttonForm</Link> </Col>                            
                            <Col> <Link to='/CheckboxForm'>CheckboxForm</Link> </Col>                                                        
                        </Row>
                        <Row>                            
                            <Col> <Link to='/ManyElemForm'>ManyElemForm</Link> </Col>                            
                            <Col> <Link to='/ManyElemFormValid'>ManyElemFormValid</Link> </Col>                            
                            <Col> <Link to='/MyFormikYup'>MyFormikYup</Link> </Col>                                                        
                        </Row>

                        <Row>                            
                            <Col> <Link to='/TwoWindows'>TwoWindows</Link>  </Col>                            
                            <Col> <Link to='/BookApp'>BookApp</Link> </Col>                            
                            <Col> <Link to='/DatabaseApp'>DatabaseApp</Link> </Col>                                                        
                        </Row>

                        <Row>                            
                            <Col> <Link to='/DataBasePerson'>DataBasePerson</Link> </Col>                            
                            <Col> <Link to='/AppStorage'>AppStorage</Link> </Col>                            
                            <Col> <Link to='/BankTrans'>BankTrans</Link> </Col>                                                        
                        </Row>

                        <Row>                            
                            <Col> <Link to='/BPersonDatabase'>BPersonDatabase</Link> </Col>                            
                            <Col> <Link to='/BootstrapDemo'>BootstrapDemo</Link> </Col>                            
                            <Col>  </Col>                                                        
                        </Row>                        
                    </Container>
                    
                    <hr />
                    <MenuRoutes />
                    <hr />
                </div>
            </BrowserRouter>
        );

    }
}

export default MenuGlob;
